  false,\n\t\"url\": null,\n\t\"notes\": \"The Geographic Names Information System
  (GNIS) actively seeks data from and partnerships with Government agencies at all
  levels and other interested organizations. The GNIS is the Federal standard for
  geographic nomenclature. The U.S. Geological Survey developed the GNIS for the U.S.
  Board on Geographic Names, a Federal inter-agency body chartered by public law to
  maintain uniform feature name usage throughout the Government and to promulgate
  standard names to the public. The GNIS is the official repository of domestic geographic
  names data; the official vehicle for geographic names use by all departments of
  the Federal Government; and the source for applying geographic names to Federal
  electronic and printed products of all types. See http://geonames.usgs.gov for additional
  information.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
